import React from 'react';
import '../balise.scss';

const BaliseLayout = () => {

return(
		<div className='baliseLayout'>
				<div className='html top'/>
				<div className='body top'/>
				<div className='body bottom'/>
				<div className='html bottom'/>
		</div>
)};

export default BaliseLayout;
